import React, { Component } from "react";

class Posts extends Component {
  render() {
    const { body, title } = this.props;
    return (
      <div style={{ border: "1px grey solid", margin: "10px", padding:"0px 20 px" }}>
        <h2>{title}</h2>
        <p>{body}</p>
      </div>
    );
  }
}

export default Posts;
